<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <!-- Пустой фавикон -->
  <link rel="icon" href="data:," />
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Playable House Selector</title>
  <script src="https://msdk.ironsrc.com/mraid/v3/mraid.js"></script>
  <style>
    /* Сброс базовых стилей для всего окна */
    html, body {
      margin: 0;
      padding: 0;
      width: 100vw;
      height: 100vh;
      overflow: hidden;
      background: black;
    }
    /* Контейнер под видео (заполняет весь экран) */
    #wrapper {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      overflow: hidden;
      z-index: 1;
    }
    /* Видео заполняет экран, сохраняет пропорции и центрируется */
    #wrapper video {
      width: 100%;
      height: 100%;
      object-fit: cover;
      object-position: center center;
    }
    /* Контейнер оверлея для UI – тоже занимает весь экран */
    #overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      pointer-events: none;
      z-index: 5;
    }
    /******************************************************
     * Общие стили для UI-элементов (иконки, лого, кнопка) *
     ******************************************************/
    .click-zone {
      position: absolute;
      display: none;
      flex-direction: row;
      justify-content: center;
      align-items: center;
      pointer-events: auto;
    }
    .click-zone img {
      width: 80px;
    }
    .endcard {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: none;
      display: none;
      pointer-events: auto;
      cursor: pointer;
    }
    .logo {
      position: absolute;
      pointer-events: auto;
      top: calc(50% - 100px);
      left: 50%;
      transform: translate(-50%, -50%);
      width: 35%;
      max-width: 350px;
      z-index: 2;
    }
    .install-button {
      position: absolute;
      pointer-events: auto;
      top: 70%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 25%;
      max-width: 250px;
      z-index: 2;
      animation: buttonBounce 1.5s infinite;
    }
    /****************************************
     *            Анимации                 *
     ****************************************/
    @keyframes logoFadeIn {
      0% {
        opacity: 0;
        transform: translate(-50%, -50%) scale(0.5);
      }
      100% {
        opacity: 1;
        transform: translate(-50%, -50%) scale(1);
      }
    }
    .logo-animate {
      animation: logoFadeIn 0.5s ease-out forwards;
    }
    @keyframes buttonBounce {
      0%, 100% {
        transform: translate(-50%, -50%) translateY(0) scale(1);
      }
      50% {
        transform: translate(-50%, -50%) translateY(-10px) scale(1.05);
      }
    }
    @keyframes shakeAnim {
      0%, 100% { transform: translateX(0); }
      25% { transform: translateX(-5px); }
      75% { transform: translateX(5px); }
    }
    .shake {
      animation: shakeAnim 0.3s;
    }
    @keyframes bounce {
      0%, 100% { transform: translateY(0); }
      50% { transform: translateY(-10px); }
    }
    .bounce {
      animation: bounce 1.5s infinite;
    }
    /**************************************
     * Медиа-запросы для ориентаций       *
     **************************************/
    /* LANDSCAPE */
    @media (orientation: landscape) {
      :root {
        --landscape-logo-top: 20%;
        --landscape-logo-width: 35%;
        --landscape-logo-max-width: 350px;
        --landscape-install-bottom: 5%;
        --landscape-install-width: 25%;
        --landscape-install-max-width: 250px;
        --landscape-click-zone-bottom: 10%;
        --landscape-icon-gap: 10px;
      }
      .logo {
        top: var(--landscape-logo-top);
        width: var(--landscape-logo-width);
        max-width: var(--landscape-logo-max-width);
      }
      .install-button {
        bottom: var(--landscape-install-bottom);
        top: auto;
        width: var(--landscape-install-width);
        max-width: var(--landscape-install-max-width);
      }
      .click-zone {
        bottom: var(--landscape-click-zone-bottom);
        left: 50%;
        transform: translateX(-50%);
        gap: var(--landscape-icon-gap);
      }
    }
    /* PORTRAIT */
    @media (orientation: portrait) {
      :root {
        --portrait-logo-top: 20%;
        --portrait-logo-width: 70%;
        --portrait-logo-max-width: 500px;
        --portrait-install-top: 85%;
        --portrait-install-width: 50%;
        --portrait-install-max-width: 500px;
        --portrait-click-zone-bottom: 12%;
        --portrait-icon-gap: 10px;
      }
      .logo {
        top: var(--portrait-logo-top);
        width: var(--portrait-logo-width);
        max-width: var(--portrait-logo-max-width);
      }
      .install-button {
        top: var(--portrait-install-top);
        bottom: auto;
        width: var(--portrait-install-width);
        max-width: var(--portrait-install-max-width);
      }
      .click-zone {
        bottom: var(--portrait-click-zone-bottom);
        left: 50%;
        transform: translateX(-50%);
        gap: var(--portrait-icon-gap);
      }
    }
      #loader {
      position: fixed;
      z-index: 999;
      background-color: #351544;
      width: 100%;
      height: 100%;
      top: 0;
      left: 0;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }

    #loader img {
      width: 60%;
      max-width: 300px;
      margin-bottom: 40px;
    }

    #progressBar {
      width: 60%;
      height: 4px;
      background-color: rgba(255, 255, 255, 0.2);
      position: relative;
      overflow: hidden;
      border-radius: 2px;
    }

    #progressBar::after {
      content: "";
      position: absolute;
      height: 100%;
      width: 40%;
      background: white;
      animation: loadingBar 1.2s infinite ease-in-out;
      border-radius: 2px;
    }

    @keyframes loadingBar {
      0% { left: -40%; }
      50% { left: 100%; }
      100% { left: 100%; }
    }
  </style>
</head>

  <script>
    let playableStarted = false;
    function onPlayableReady() {
      if (playableStarted) return;
      playableStarted = true;
      console.log("✅ MRAID is ready");

      function sendTrackingEvent(eventName) {
        if (window.parent && window.parent.postMessage) {
          window.parent.postMessage({ event: eventName }, "*");
        } else {
          console.log("Tracking event:", eventName);
        }
      }
      
      const video = document.getElementById('video');
      const bgm = document.getElementById('bgm');
      const zone1 = document.getElementById('zone1');
      const zone2 = document.getElementById('zone2');
      const endcard = document.getElementById('endcard');
      const loader = document.getElementById('loader');
      let pauses = [4.8, 10.09];
      let currentPause = 0;

      document.addEventListener('click', () => {
        if (video) {
          video.muted = false;
          video.volume = 1;
        }
        if (bgm) {
          bgm.volume = 0.6;
          bgm.play().catch(err => console.error('BGM play error:', err));
        }
        sendTrackingEvent("Ad Start");
      }, { once: true });

      video.addEventListener('timeupdate', () => {
        if (currentPause < pauses.length && video.currentTime >= pauses[currentPause]) {
          video.pause();
          showClickZone(currentPause);
          currentPause++;
        }
      });

      function showClickZone(index) {
        if (index === 0) {
          zone1.style.display = 'flex';
        } else if (index === 1) {
          zone2.style.display = 'flex';
        }
      }

      video.addEventListener('ended', () => {
        sendTrackingEvent("Ad Complete");
        endcard.style.display = 'block';
        if (typeof ISFI !== 'undefined' && ISFI.sendEvent) {
          ISFI.sendEvent('AdCompleted');
        }
      });

      video.addEventListener('error', () => {
        sendTrackingEvent("Ad Fallback");
        endcard.style.display = 'block';
      });

      function shake(el) {
        el.parentElement.classList.add('shake');
        setTimeout(() => {
          el.parentElement.classList.remove('shake');
        }, 500);
      }


      video.addEventListener('canplaythrough', () => {
        if (loader) loader.style.display = 'none';
      });
      setTimeout(() => {
        if (loader) loader.style.display = 'none';
      }, 3000);

      if (typeof mraid !== 'undefined') {
        mraid.addEventListener('stateChange', function(state) {
          if (state === 'hidden') {
            try {
              if (typeof bgm !== 'undefined') bgm.volume = 0;
              if (typeof video !== 'undefined') video.volume = 0;
            } catch (e) { console.log('mute error', e); }
          }
        });
      }

      video.addEventListener('play', () => {
        if (typeof ISFI !== 'undefined' && ISFI.sendEvent) {
          ISFI.sendEvent('AdStarted');
        }
      });
    }


    if (window.mraid) {
      try {
        const state = mraid.getState();
        console.log("📣 mraid.getState() =", state);
        if (state === "loading") {
          mraid.addEventListener("ready", onPlayableReady);
        } else {
          onPlayableReady();
        }
      } catch (e) {
        console.warn("⚠️ mraid.getState() threw error", e);
        onPlayableReady();
      }
    } else {
      console.log("🧪 mraid not found — fallback to browser mode");
      window.addEventListener("load", onPlayableReady);
    }

    
    function nextStep(zone) {
        zone.style.display = 'none';
        video.play();
      }
      
    function onCTAClick() {
    console.log("CTA click tracked");
    const storeUrl = 'https://play.google.com/store/apps/details?id=com.socialquantum.acityint'; // <-- сюда ваш URL

    // Если MRAID доступен — открываем стор через него
    if (window.mraid && typeof mraid.open === 'function') {
      mraid.open(storeUrl);
    } else {
      // Иначе — fallback: отправляем сообщение хосту и/или делаем window.open
      window.parent.postMessage({ event: 'CTA Click' }, '*');
      // или, вместо postMessage, можно сразу:
      // window.open(storeUrl, '_blank');
    }
  }


</script>
